// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
//  Libarys
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
//  Security
import "@openzeppelin/contracts/access/Ownable.sol";
//  ChainLink
import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
//  Interfaces
import "./interfaces/IdegenExchangeData.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
//  Interface Receiver's
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

/**
*   @dev    -   IERC721 interfaceId - 0x80ac58cd
*   @dev    -   IERC1155 interfaceId - 
*
 */

contract degenExchangeRegistry is VRFConsumerBaseV2, ERC165, IdegenExchangeData, Ownable {
    VRFCoordinatorV2Interface COORDINATOR;

    using Address for address;
    using Strings for uint256;

    TokenData[] private  _tokensInDraw;

    address private FEE_PAYABLE_ADDRESS;
    uint256 private MINIMAL_TOKENS_FOR_DRAW = 2;    //  +1 for actual number 
    uint256 private DEPOSIT_COUNT = 0;
    uint256 private DRAW_COUNT = 0;
    uint256 private MAX_CONCURRENT_ENTRYS_PER_WALLET = 1;   
    uint256 private DEPOSIT_FEE = 0.002 ether;

    bool private _paused = false;


     // The RNG subscription ID.
     uint64 private _subscriptionId ;
     // Rinkeby coordinator
     address private _vrfCoordinator = 0x6168499c0cFfCaCD319c818142124B7A15E857ab;
     // The gas lane to use, which specifies the maximum gas price to bump to.
     bytes32 private _keyHash = 0xd89b2bf150e3b9e13446986e571fb9cab24b13cea0a43ea20a6049a85cc807cc;
     //  Callback gas cost
     uint32 private _callbackGaslimit = 2800000;
     //  How many confirmations to wait for, min 3
     uint16 _minimumRequestConfirmations = 3;
     //  How many sets of random numbers
     uint32 _amountOfNumbersToRequest = 1;
     //  Draws in cue
     uint256 private _DrawsInLine = 0;
     //  Mapping of requestIds to Draw trigger address
     mapping(uint256 => address) internal _requestIdMapping;
     //  Mapping of requestIds to DrawId
     mapping(uint256 => uint256) internal _drawTriggers;
     //  Mapping of amount of draws to spend to wallet address
     mapping(address => uint256) internal userDepositCount_;

     mapping(uint256 => uint256) private _DrawIdToVRN;

     mapping(uint256 => bool) private _completeDraws;

    constructor(uint64 subscriptionId_, address feeWallet_)VRFConsumerBaseV2(_vrfCoordinator){
        FEE_PAYABLE_ADDRESS = feeWallet_;
        COORDINATOR = VRFCoordinatorV2Interface(_vrfCoordinator);
        _subscriptionId = subscriptionId_;

        //Add an Empty entry to the array to full index 0
        TokenData memory insertZero;
        insertZero.contractOfToken = 0x0000000000000000000000000000000000000000;
        insertZero.ownerAddress = 0x0000000000000000000000000000000000000000;
        insertZero.tokenId = 0;

        _tokensInDraw.push(insertZero);
    }

    modifier addressHasDraws(){
        require(userDepositCount_[_msgSender()] > 0, "Need to deposit to have a draw!");
        _;
    }

    modifier activeNFTCount(){
        require(getAvalabuleNFTsInDraw() > MINIMAL_TOKENS_FOR_DRAW, "Not Enough NFTs in the vault to draw");
        _;
    }

    modifier isPaused(){
        require(!_paused, "Sorry the Draw is Paused at the moment");
        _;
    }
    /**
    *           Deposit functions
    */
    function EnterNFTDraw(address addressForNFTContract_, uint256 tokenId_, bytes4 interfaceId_) public payable isPaused{
        require(msg.value == DEPOSIT_FEE, "Need to include the deposit fee");
        require(userDepositCount_[_msgSender()]< MAX_CONCURRENT_ENTRYS_PER_WALLET, "Max Entrys Per Wallet Reached");

        _switchTransferInterface(addressForNFTContract_, tokenId_, interfaceId_, 1, _msgSender());

        unchecked {
            TokenData memory newEntry;
            newEntry.contractOfToken = addressForNFTContract_;
            newEntry.ownerAddress = _msgSender();
            newEntry.interfaceId = interfaceId_;
            newEntry.tokenId = tokenId_;

            _tokensInDraw.push(newEntry);
            userDepositCount_[_msgSender()] ++;
            DEPOSIT_COUNT ++;
        }

        emit DepositedNFT(_msgSender(), addressForNFTContract_, tokenId_);
    }

    /**
    *       @notice -   THIS FUNCTION IS ONE WAY. YOU DO NOT GET A DRAW FOR SUBMITTING
    *                   Used for entering an NFT to the pool but not reciving a draw entry
    *                   Made for NFT projects to build their comunity
    */
    function submitNFT(address addressForNFTContract_, uint256 tokenId_, bytes4 interfaceId_)public isPaused {
        _switchTransferInterface(addressForNFTContract_, tokenId_, interfaceId_, 1, _msgSender());

        TokenData memory newEntry;
        newEntry.contractOfToken = addressForNFTContract_;
        newEntry.ownerAddress = 0x0000000000000000000000000000000000000000;
        newEntry.interfaceId = interfaceId_;
        newEntry.tokenId = tokenId_;

        _tokensInDraw.push(newEntry);
        DEPOSIT_COUNT ++;

        emit GiftedNFT(_msgSender(), addressForNFTContract_, tokenId_);
    }

    /**
    *           Draw functions
    */
    function TriggerDraw()public addressHasDraws activeNFTCount isPaused{
        _requestRandomNumbers();
    }

    function _requestRandomNumbers()internal {
        uint256 requestId_ = COORDINATOR.requestRandomWords(
            _keyHash, 
            _subscriptionId, 
            _minimumRequestConfirmations, 
            _callbackGaslimit, 
            _amountOfNumbersToRequest
        );

        if(requestId_ > 0){
            address requester_ = _msgSender();
            DRAW_COUNT ++;
            _requestIdMapping[requestId_] = requester_;
            _DrawsInLine ++;
            _drawTriggers[requestId_] = DRAW_COUNT;
            userDepositCount_[_requestIdMapping[requestId_]] --;
            emit DrawInitiated(requester_, DRAW_COUNT);
        } else {
            revert FaildToRequestRandomNumbers(requestId_);
        }
    }

     function forceFullfillTrigger(uint256 drawId_)public onlyOwner {
    require(!_completeDraws[drawId_], "Draw has alredy been completed");
    _fullfillFinalDraw(_DrawIdToVRN[drawId_], drawId_);
   }

    function rawFulfillRandomWords(uint256 requestId, uint256[] memory randomWords) external override {
    if (msg.sender != _vrfCoordinator) {
      revert OnlyCoordinatorCanFulfill(msg.sender, _vrfCoordinator);
    }
    fulfillRandomWords(requestId, randomWords);
  }
    function fulfillRandomWords(
        uint256 requestId,
        uint256[] memory randomWords
      ) internal override {
        uint256 newNumber = randomWords[0];

        _DrawIdToVRN[_drawTriggers[requestId]] = newNumber;
        require(_requestIdMapping[requestId] == address(_requestIdMapping[requestId]), "Request ID Not found");
        require(!_completeDraws[_drawTriggers[requestId]], "Draw has alredy been completed");
        _fullfillFinalDraw(newNumber, requestId);      
    } 

    function _fullfillFinalDraw(uint256 returnedNumber_, uint256 requestId_) internal {
        uint256 roll = returnedNumber_ % getAvalabuleNFTsInDraw();

        unchecked {
            if(roll < 1) roll ++;
            while(_tokensInDraw[roll].ownerAddress == _requestIdMapping[requestId_] ){
                if(roll < 2){
                    roll ++; 
                } else {
                    roll = roll * block.timestamp % DEPOSIT_COUNT;
                }
            }
        }

        TokenData memory drawnToken = _tokensInDraw[roll];
        _switchTransferInterface(drawnToken.contractOfToken, drawnToken.tokenId, drawnToken.interfaceId, 0, _requestIdMapping[requestId_]);
        _removeNFTFromDrawArray(roll);


        DEPOSIT_COUNT --;
        _DrawsInLine --;

        _completeDraws[_drawTriggers[requestId_]] = true;
        emit DrawComplete(_requestIdMapping[requestId_], drawnToken.contractOfToken, drawnToken.tokenId,  _drawTriggers[requestId_]);        
    }

    function _removeNFTFromDrawArray(uint index_) internal {
        if(index_ >= _tokensInDraw.length)return;

        unchecked {
            uint i = index_;
            do { 
                _tokensInDraw[i] = _tokensInDraw[i+1];
                i++;
            } while (i<_tokensInDraw.length-1);
            _tokensInDraw.pop();
        }

    }


    /**
    *           Transfering In & Out
    */

    /**
    *
    *   @notice    -   1 = In && 0 = Out
    *
    */
    function _switchTransferInterface(address addressForNFTContract_, uint256 tokenId_, bytes4 interfaceId_, uint256 inOrOut_, address reciver_) internal {
        if(interfaceId_ == type(IERC721).interfaceId){
            if (inOrOut_ > 0){
                 _transferInERC721(addressForNFTContract_, tokenId_); 
            }else{ 
                _transferOutERC721(addressForNFTContract_, tokenId_, reciver_);
            }
            return;
        }
        if(interfaceId_ == type(IERC1155).interfaceId){
            if(inOrOut_ > 0 ) {
                _transferInERC1155(addressForNFTContract_, tokenId_);
            }else {
                _transferOutERC1155(addressForNFTContract_, tokenId_, reciver_);
            }
            return;
        }
        revert InvaliedContractInterfce(interfaceId_);
    }

    function _transferInERC721(address addressForNFTContract_, uint256 tokenId_)private {
        IERC721(addressForNFTContract_).transferFrom(_msgSender(), address(this), tokenId_);
    }

    function _transferInERC1155(address addressForNFTContract_, uint256 tokenId_)private {
        bytes memory data;
        IERC1155(addressForNFTContract_).safeTransferFrom(_msgSender(), address(this), tokenId_, 1, data);
    }

    function _transferOutERC721(address addressForNFTContract_, uint256 tokenId_, address reciver_)private {
        IERC721(addressForNFTContract_).transferFrom(address(this), reciver_, tokenId_);
    }

    function _transferOutERC1155(address addressForNFTContract_, uint256 tokenId_, address reciver_)private {
        bytes memory data;
        IERC1155(addressForNFTContract_).safeTransferFrom(address(this), reciver_, tokenId_, 1, data);
    }


    /**
    *           Supported Interfaces & Token IO
    */
     function supportsInterface(bytes4 interfaceId_) public view virtual override(ERC165) returns (bool) {
        return
            interfaceId_ == type(IERC1155).interfaceId || interfaceId_ == type(IERC721).interfaceId || super.supportsInterface(interfaceId_);
    }

